package java_handson;

public class forloop_print_11_to_20_using_break {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// print numbers from 11 to 20 
		
				for(int i=1;i<100;i++)
				{
					
					System.out.println(i);
					if(i==20)
					{
						break;
					}
				}

	}

}
